    function ObtenerArchivo($id){
        
        $query='SELECT D.Codigo as DIS, A.Archivo, TS.Nombre as Tipo_Servicio,
                A.Id_Auditoria, D.Acta_Entrega, D.Firma_Reclamante, D.Id_Dispensacion, 
                (SELECT GROUP_CONCAT(CONCAT_WS(";",SA.Id_Tipo_Soporte,TS.Nombre_Radicacion,SA.Paginas)) FROM Soporte_Auditoria SA INNER JOIN Tipo_Soporte TS ON TS.Id_Tipo_Soporte = SA.Id_Tipo_Soporte WHERE SA.Id_Auditoria = A.Id_Auditoria) AS Soportes 
                FROM Dispensacion D 
                LEFT JOIN Tipo_Servicio TS ON TS.Id_Tipo_Servicio = D.Id_Tipo_Servicio
                LEFT JOIN Auditoria A ON A.Id_Dispensacion = D.Id_Dispensacion
                
                WHERE D.Codigo IN ('.getPaquete($id).')';
        
        $oCon = new consulta();
        $oCon->setQuery($query);
        $oCon->setTipo('Multiple');
        $facturas = $oCon->getData();
        unset($oCon);
        
        return ($facturas);
        
    }
 
